import React from 'react';
import {BrowserRouter as Router,Route} from "react-router-dom";
import "./App.css";

import Main from './pages/Main';
import Login from './pages/Login'
import Registeration from './pages/Registeration';
import Menumember from './pages/Menumember';
import Menushop from './components/Menushop';
import Tranferpoint from './components/Tranferpoint';
import Transection from './components/Transection';
import Promotion from './components/Promotion';
import Memberprofile from './components/Memberprofile';
import Tranferpointshop from './components/Tranferpointshop';
import Calculatepointshop from './components/Calculatepointshop';
import Transectionshop from './components/Transectionshop';
import Promotionshop from './components/Promotionshop';
import Topuppointshop from './components/Topuppointshop';
import Shopprofile from './components/Shopprofile';

function App() {
  return (
    <Router>
      <Route path="/registration" exact render={(props) => <Registeration/>} />
      <Route path="/" exact render={(props) => <Main />} />
      <Route path="/login" exact render={(props) => <Login />} />
      <Route path="/menumember" exact render={(props) => <Menumember />} />
      <Route path="/menushop" exact render={(props) => <Menushop />} />
      <Route path="/transfer-point" exact render={(props) => <Tranferpoint />} />
      <Route path="/transection" exact render={(props) => <Transection />} />
      <Route path="/promotion" exact render={(props) => <Promotion />} />
      <Route path="/memberprofile" exact render={(props) => <Memberprofile />} />
      <Route path="/tranfer-point-shop" exact render={(props) => <Tranferpointshop />} />
      <Route path="/calculate-point-shop" exact render={(props) => <Calculatepointshop />} />
      <Route path="/transection-shop" exact render={(props) => <Transectionshop />} />
      <Route path="/promotion-shop" exact render={(props) => <Promotionshop />} />
      <Route path="/top-up-point-shop" exact render={(props) => <Topuppointshop />} />
      <Route path="/shopprofile" exact render={(props) => <Shopprofile />} />




    </Router>
  );
}

export default App;
